import './playlistList.css';

import {
  Playlist,
  PlaylistItem,
  PlaylistListener,
  PlaylistDetail
} from './playlistResource';

const PlayCoPlaylistList = (props) => {
  return <section className='playCoPlaylistList' {...props}>
    <header>
      <h2>PlayCO</h2>
    </header>

  </section>;
};

export { PlayCoPlaylistList };
